class GoogleAuth extends Component {
    componentWillMount() {
        window.gapi.load('client:auth2', () => {
            window.gapi.client.init({
                clientId: '49451685533 - gtu2iqek0citiq2b20jm8l06v5jpsvg2.apps.googleusercontent.com'
            });
        });
    }

    render() {
        return (
            <div>GoogleAuth</div>
        );
    }
}

export default GoogleAuth;
